import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter as Router } from 'react-router-dom'; // Certifique-se de que está importando o BrowserRouter
import './globals.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);

root.render(
  <React.StrictMode>
    <Router> {/* Envolva o App com BrowserRouter */}
      <App />
    </Router>
  </React.StrictMode>
);

reportWebVitals();
